import React from 'react';
import './StatusBar.css';

function StatusBar() {
    return (
        <header className="status-bar">
            <button id="menu-button" className="menu-button">&#9776;</button>
            <h1 className="app-name">Miruyume</h1>
            <button id="chat-button" className="chat-button">&#128172;</button>
        </header>
    );
}

export default StatusBar;
